backgroundColor.code:
wwFormulas.if(context.item.data?.['status']  == 'open', '#DBEAFE', // Azul claro para Aberto
  wwFormulas.if(context.item.data?.['status']  == 'in_progress', '#FEF3C7', // Amarelo para Em Andamento
    wwFormulas.if(context.item.data?.['status']  == 'done', '#D1FAE5', // Verde para Concluído
      wwFormulas.if(context.item.data?.['status']  == 'canceled', '#FEE2E2', '#E5E7EB') // Vermelho para Cancelado, Cinza para outros
    )
  )
)

